import './App.css';
import { BrowserRouter, Navigate, Route, Routes } from 'react-router-dom'
import Home from './'

function App() {
  return (
    <div>
      <BrowserRouter>

        <Routes>

          <Route element={<Navigate to='/homepage' />} path='/'/>
          <Route element={<Home />} path='homepage'/> 

        </Routes>

      </BrowserRouter>
    </div>
  );
}

export default App;
